def predict_Disease():
    
    global plainText
    
    noCheckBoxChecked = True
    userSym_Count = 0

    for i in range(len(checkboxes_List) - 1):
        if checkboxes_List[i].isChecked():
            user_symptoms[userSym_Count] = checkboxes_List[i].text()
            userSym_Count += 1
            noCheckBoxChecked = False

        ### Limite a 17 sintomi massimi
        if userSym_Count == 17:
            break;

    if not noCheckBoxChecked:
        predicted_Disease_Msg = main.pred_Disease(current_classifier, user_symptoms)  

        plainText[0].setPlainText(predicted_Disease_Msg)
    else:
        print("Nessun sintomo selezionato, si prega di selezionarne alcuni")
        plainText[0].setPlainText("Nessun sintomo selezionato, si prega di selezionarne alcuni")  

    resetSymp()

def resetSymp():
    for i in range(len(user_symptoms) - 1):
        user_symptoms[i] = 0

    for i in range(len(checkboxes_List) - 1):
        if checkboxes_List[i].isChecked():
            checkboxes_List[i].setChecked(False)

